import React from 'react';
import './style.css';

import BlogPost from '../../components/BlogPost';
import Sidebar from '../../components/Sidebar';
import Layout from '../../components/Layout';

/**
* @author
* @function Post
**/

const Post = (props) => {
  
  return(
   
    <Layout>
      <BlogPost{...props}/>
    </Layout>
    
   )

 }

export default Post;
